import React from 'react';

const VideoItem = ({ snippet }) => {
  console.log(snippet);
  return (
    <div className="item">
      <img src={snippet.thumbnails.medium.url} alt={snippet.description} />
      {snippet.title}
    </div>
  );
};

export default VideoItem;
